import React from 'react';
import Select from '@material-ui/core/Select';
import Grid from '@material-ui/core/Grid';
import MenuItem from '@material-ui/core/MenuItem';
import DateFns from 'date-fns';
import LocalizationProvider from '@material-ui/lab/LocalizationProvider';

export default function DayInputs(props) {
    const {daysOBJ, setDays, abvList} = props

    function handleChange(e, i) {
        e.persist();
        console.log("error:", e.target);
        setDays(prevDays => ({...prevDays, [e.target.name]: e.target.value }));
        // //console.log(timeCard);
    }

    function getTimeInput(abv, end){
        return(<div>
            <Select
                variant="outlined"
                fullWidth
                id={`${abv}Type Reg Vac Sick Pers Hol${end}`}
                label="Type"
                name={`${abv}Type Reg Vac Sick Pers Hol${end}`}
                value={daysOBJ[`${abv}Type Reg Vac Sick Pers Hol${end}`]}
                onChange={handleChange}
            >
                <MenuItem value={"Reg"}>Reg</MenuItem>
                <MenuItem value={"Vac"}>Vac</MenuItem>
                <MenuItem value={"Sick"}>Sick</MenuItem>
                <MenuItem value={"Pers"}>Pers</MenuItem>
                <MenuItem value={"Hol"}>Hol</MenuItem>
            </Select>

            <TimePicker
                label="Basic example"
                value={value}
                onChange={(newValue) => {
                setValue(newValue);
            }}
            renderInput={(params) => <TextField {...params} />}
            />
        </div>            
        )
    }


    return (<div><LocalizationProvider dateAdapter={AdapterDateFns}>
            {abvList.map((abv, i) => {
                return(<Grid>
                    <p>{abv}-{daysOBJ[`${abv}Date_es_:date`]}</p>


                    <Select
                        variant="outlined"
                        fullWidth
                        id={`${abv}Type Reg Vac Sick Pers Hol2`}
                        label="Type"
                        name={`${abv}Type Reg Vac Sick Pers Hol2`}
                        value={daysOBJ[`${abv}Type Reg Vac Sick Pers Hol2`]}
                        onChange={handleChange}
                    >
                        <MenuItem value={"Reg"}>Reg</MenuItem>
                        <MenuItem value={"Vac"}>Vac</MenuItem>
                        <MenuItem value={"Sick"}>Sick</MenuItem>
                        <MenuItem value={"Pers"}>Pers</MenuItem>
                        <MenuItem value={"Hol"}>Hol</MenuItem>
                    </Select>
                    
                    <Select
                        variant="outlined"
                        fullWidth
                        id={`${abv}Type Reg Vac Sick Pers Hol3`}
                        label="Type"
                        name={`${abv}Type Reg Vac Sick Pers Hol3`}
                        value={daysOBJ[`${abv}Type Reg Vac Sick Pers Hol3`]}
                        onChange={handleChange}
                    >
                        <MenuItem value={"Reg"}>Reg</MenuItem>
                        <MenuItem value={"Vac"}>Vac</MenuItem>
                        <MenuItem value={"Sick"}>Sick</MenuItem>
                        <MenuItem value={"Pers"}>Pers</MenuItem>
                        <MenuItem value={"Hol"}>Hol</MenuItem>
                    </Select>
                    
                    <Select
                        variant="outlined"
                        fullWidth
                        id={`${abv}Type Reg Vac Sick Pers Hol4`}
                        label="Type"
                        name={`${abv}Type Reg Vac Sick Pers Hol4`}
                        value={daysOBJ[`${abv}Type Reg Vac Sick Pers Hol4`]}
                        onChange={handleChange}
                    >
                        <MenuItem value={"Reg"}>Reg</MenuItem>
                        <MenuItem value={"Vac"}>Vac</MenuItem>
                        <MenuItem value={"Sick"}>Sick</MenuItem>
                        <MenuItem value={"Pers"}>Pers</MenuItem>
                        <MenuItem value={"Hol"}>Hol</MenuItem>
                    </Select>

                </Grid>)
            })}  
            </LocalizationProvider></div>)
}
